// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Funder {
    uint public numOfFunders;
    mapping(uint => address) private funders;

    // Function to receive Ether. msg.data must be empty
    receive() external payable {}

    // Function to handle Ether transfers
    function transfer() external payable {
        funders[numOfFunders] = msg.sender;
        numOfFunders++;
    }

    // Function to withdraw Ether
    function withdraw(uint withdrawAmount) external {
        require(withdrawAmount <= 2 ether, "cannot withdraw more than 2 ethers");
        require(address(this).balance >= withdrawAmount, "Insufficient balance in contract");
        payable(msg.sender).transfer(withdrawAmount);
    }
}
